import React from "react";
import { useDispatch } from "react-redux";
import { useSelector } from "react-redux";
import { useState, useEffect } from "react";
import { searchTypes } from "../actions";
import { NavLink } from "react-router-dom";

export function CreatePok() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(searchTypes());
  }, []);
  const types = useSelector((state) => state.types);

  const [input, setInput] = useState({
    name: "",
    type: [],
    img: "",
    hp: "",
    attack: "",
    defense: "",
    speed: "",
    id: "",
    height: "",
    weight: "",
  });
  function handleChange(e) {
    setInput({ ...input, [e.traget.name]: e.target.value });
  }
  return (
    <div>
      <NavLink to="/pokemon">Go Back</NavLink>
      <form>
        <label>Name</label>
        <input
          type="text"
          value={input.name}
          name="name"
          onChange={handleChange}
        />
        <label>Img</label>
        <input
          type="text"
          value={input.name}
          name="img"
          onChange={handleChange}
        />
        <label>Type</label>
        <input
          type="text"
          value={input.name}
          name="type"
          onChange={handleChange}
        />
        <label>Hp</label>
        <input
          type="number"
          value={input.name}
          name="hp"
          onChange={handleChange}
        />
        <label>Attack</label>
        <input
          type="number"
          value={input.name}
          name="attack"
          onChange={handleChange}
        />
        <label>Defense</label>
        <input
          type="number"
          value={input.name}
          name="defense"
          onChange={handleChange}
        />
        <label>Speed</label>
        <input
          type="number"
          value={input.name}
          name="speed"
          onChange={handleChange}
        />
        <label>Id</label>
        <input
          type="number"
          value={input.name}
          name="id"
          onChange={handleChange}
        />
        <label>Height</label>
        <input
          type="number"
          value={input.name}
          name="height"
          onChange={handleChange}
        />
        <label>Weight</label>
        <input
          type="number"
          value={input.name}
          name="weight"
          onChange={handleChange}
        />
        <button type="submit">Create your Pokemon!</button>
      </form>
    </div>
  );
}
export default CreatePok;
